import { getDataInterfaceLog } from '@/api/systemData/dataInterface'
import { deepClone } from '@/utils'
const listQuery = {
  keyword: '',
  currentPage: 1,
  pageSize: 20,
  sort: 'desc',
  sidx: ''
}
export default {
  data() {
    return {
      id: '',
      title: '',
      list: [],
      total: 0,
      listLoading: true,
      listQuery: {}
    }
  },
  methods: {
    goBack() {
      this.$emit('close')
    },
    init(id, title) {
      if (!id) return this.$emit('close')
      this.id = id
      this.title = title
      this.reset()
    },
    initData() {
      this.listLoading = true
      getDataInterfaceLog(this.id, this.listQuery).then(res => {
        this.list = res.data.list
        this.total = res.data.pagination.total
        this.listLoading = false
      })
    },
    reset() {
      this.listQuery = deepClone(listQuery)
      this.initData()
    },
    search() {
      const keyword = this.listQuery.keyword
      this.listQuery = deepClone(listQuery)
      this.listQuery.keyword = keyword
      this.initData()
    }
  }
}
